window.bookSummaryJSON = "<p><b>Hugh Logan and the other human cores of the expeditionary force are back home, but the cost of keeping their allies alive has been a heavy one.</b></p> <p>Not happy about losing their prey, the Ssath continue to use the vast resources at their disposal to seek total victory over humanity. They will stop at nothing until Earth’s cores are defeated and the planet is transformed into a feeding ground and hunting preserve.</p> <p>Hugh and the other cores must prepare. The enemy is closing in, and the next battle will be fought here on Earth. They’ll need every soldier, every mech, and every ally they can gather if humanity is to survive.</p>"; 
